Hey Leute,

ich habe es vergangene Season bis Diamond 1 39 LP geschafft und befinde mich momentan im Diamond 1 bis 3 Bereich, da ich gerade ein wenig experimentiere und neue Dinge probieren will. Anscheinend sollen ja Movementspeed Champs wie Warwick und Heca OP sein, von daher teste ich mich mal vorsichtig an die heran :&gt;

Ich werde heute Abend und morgen ab Vormittag/Mittag bisschen l&auml;nger streamen. Wer noch Fragen zum Jungle hat oder sich bisschen das Gameplay anschauen und paar Tricks und Tipps &uuml;bernehmen will, darf sehr gerne einschalten und mit mir chatten oder mich Ingame adden, damit man sich &uuml;ber heute hinaus auch austauschen kann :)
